INSERT INTO `wp_options` VALUES("4422", "_transient_dash_f69de0bbfe7eaa113146875f40c02000", "<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/08/wordpress-4-8-1-maintenance-release/\'>WordPress 4.8.1 Maintenance Release</a> <span class=\"rss-date\">2nd Август 2017</span><div class=\"rssSummary\">After over 13 million downloads of WordPress 4.8, we are pleased to announce the immediate availability of WordPress 4.8.1, a maintenance release. This release contains 29 maintenance fixes and enhancements, chief among them are fixes to the rich Text widget and the introduction of the Custom HTML widget. For a full list of changes, consult the release [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/new-merlin-wp-onboarding-wizard-makes-wordpress-theme-installation-and-setup-effortless\'>WPTavern: New Merlin WP Onboarding Wizard Makes WordPress Theme Installation and Setup Effortless</a></li><li><a class=\'rsswidget\' href=\'https://poststatus.com/building-healthy-remote-company-tom-willmot-draft-podcast/\'>Post Status: Building a healthy remote company, with Tom Willmot — Draft podcast</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/user-experience-tests-show-gutenbergs-ui-elements-can-benefit-from-better-timing\'>WPTavern: User Experience Tests Show Gutenberg’s UI Elements Can Benefit From Better Timing</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Популярный плагин:</span> Yoast SEO&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=wordpress-seo&amp;_wpnonce=5fc9147594&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Установить Yoast SEO\">(Установить)</a></li></ul></div>", "no");
