INSERT INTO `wp_options` VALUES("1814", "_transient_dash_5f25301ca0145abac6dfc3a0899dc43b", "<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/01/wordpress-4-7-1-security-and-maintenance-release/\'>WordPress 4.7.1 Security and Maintenance Release</a> <span class=\"rss-date\">11th January 2017</span><div class=\"rssSummary\">WordPress 4.7 has been downloaded over 10 million times since its release on December 6, 2016 and we are pleased to announce the immediate availability of WordPress 4.7.1. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7 and earlier are affected by eight security issues: [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://poststatus.com/shaping-success-wordcamps/\'>Post Status: Shaping a vision of success</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/jetpack-4-5-expands-monetization-with-wordads-integration\'>WPTavern: Jetpack 4.5 Expands Monetization with WordAds Integration</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/wpweekly-episode-260-siteground-affiliate-summit-recap-and-new-security-czar\'>WPTavern: WPWeekly Episode 260 – SiteGround, Affiliate Summit Recap, and New Security Czar</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> Google Analytics Dashboard for WP&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=3484cc8e02&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install Google Analytics Dashboard for WP\">(Install)</a></li></ul></div>", "no");
