INSERT INTO `wp_posts` VALUES("156", "1", "2017-01-24 15:19:44", "2017-01-24 13:19:44", "<label> Ваше имя (обязательно)\r\n    [text* your-name] </label>\r\n\r\n<label> Ваш e-mail (обязательно)\r\n    [email* your-email] </label>\r\n\r\n<label> Адрес\r\n    [text your-address] </label>\r\n\r\n<label> Время работы\r\n    [textarea your-time-work] </label>\r\n\r\n<label> Новости\r\n    [textarea your-news] </label>\r\n\r\n<label> Акции\r\n    [textarea your-stock] </label>\r\n\r\n<label> Описание\r\n    [textarea your-description] </label>\r\n\r\n<label> Другое\r\n    [textarea your-other] </label>\r\n\r\n[submit \"Отправить\"]\nMedService24 Изменение информации личного кабинета\n[your-name] <wordpress@medservice24.pirise.com>\nОт: [your-name] <[your-email]>\r\n\r\nАдрес: [your-address]\r\nВремя работы: [your-time-work]\r\nНовости:\r\n[your-news]\r\nАкции:\r\n[your-stock]\r\nОписание:\r\n[your-description]\r\nДругое:\r\n[your-other]\r\n\r\n\r\n--\r\nЭто сообщение отправлено с сайта MedService24 (http://medservice24.pirise.com)\npaffen.web@gmail.com\nReply-To: [your-email]\n\n\n\n\nMedService24 \"[your-subject]\"\nMedService24 <wordpress@medservice24.pirise.com>\nСообщение:\r\n[your-message]\r\n\r\n--\r\nЭто сообщение отправлено с сайта MedService24 (http://medservice24.pirise.com)\n[your-email]\nReply-To: paffen.web@gmail.com\n\n\n\nСпасибо за внесенные изменения. Данные отправлены администратору на модерацию. Время обработку 24 часа\nПроизошла ошибка при попытке отправить Ваше сообщение. Пожалуйста попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста проверьте их и попробуйте ещё раз.\nПроизошла ошибка при попытке отправить Ваше сообщение. Пожалуйста попробуйте ещё раз позже.\nВы должны принять условия и положения перед тем, как отправлять Ваше сообщение.\nПоле обязательно.\nПоле слишком длинное.\nПоле слишком короткое.\nФормат даты некорректен.\nВведённая дата слишком далеко в прошлом.\nВведённая дата слишком далеко в будущем.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nФайл слишком большой.\nПри загрузке файла произошла ошибка.\nФормат числа некорректен.\nЧисло меньше минимально допустимого.\nЧисло больше максимально допустимого.\nОтвет на задачку неверен.\nКод введен неверно.\nВведённый электронный адрес неверен.\nАдрес ссылки неверен.\nНомер телефона неверен.", "Updates form Cabinet", "", "publish", "closed", "closed", "", "updates-form-cabinet", "", "", "2017-01-31 18:45:12", "2017-01-31 16:45:12", "", "0", "http://medservice24.pirise.com/?post_type=wpcf7_contact_form&#038;p=156", "0", "wpcf7_contact_form", "", "0");
